.page-container>div {

.col-left {

}

    max-width: 75%;

}

.col-left p {
    font-size: 56px;
    padding: 0 0 0 70px;

    margin: 0 0 10px 0;
    text-transform: capitalize;
}

.page-container {
    display: flex;
    flex-wrap: wrap;
}

.col-right {
    display: flex;
    align-items: center;
    justify-content: center;
}

.login-col {
    background: #1c7444;
    min-width: 70%;

}

.login-header img {
    max-width: 102px;
}

.login-body {
    padding: 0 60px;
}

.login-body .name {
    text-align: center;
    color: white;
    font-size: 59px;
    margin: -30px 0 25px 0;
}

.login-body .field {
    width: 100%;
    border-radius: 0px;
    height: 42px;
    border: solid 1px lightgrey;
    padding: 0px 10px;
    font-size: 14px;
    font-weight: 600;
    font-family: 'Open Sans', sans-serif;
}

.login-body .form-group {
    margin: 0 0 15px 0;
}

.login-body .btn {
    margin: auto;
    display: table;
    background: #00339c;
    color: white;
    border: solid 1px #00339c;
    font-size: 16px;
    padding: 10px 30px;
    transition: 0.2s;
    cursor: pointer;
}

.login-col .start {
    color: white;
    font-weight: 600;
    font-size: 16px;
    position: relative;
    top: 8px;
    left: 10px;
}

.login-body .btn:hover {
    background: #4ca474;
    border-color: #4ca474;
}
.login-header {
    padding: 8px 10px;
}
.logo {
    position: absolute;
    right: 30px;
    top: 16px;
    max-width: 230px;
}

        padding: 24px 0;

    }

    .col-left p {

        margin: auto;

    .login-body .name {

        margin: 0px 0 12px 0;

        max-width: 65px;
    }

        padding: 0 24px;

    }

        font-size: 14px;
    }

    .login-col .start {
        font-size: 14px;
        top: -7px;
        left: 10px;
    }
    .logo {

        top: 16px;
        max-width: 170px;
        left: 50%;

    body {
        padding-top: 65px;
    }
}

@media(min-width: 768px) and (max-width: 991px) {

        font-size: 12px;

    }

        max-width: 136px;
    }
}

        padding: 0 0 0 41px;
        line-height: 48px;
    }
    .logo {
        max-width: 136px;
    }
}
